import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

const Register = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    password: '',
    role: 'WORKER',
    // Worker specific fields
    skills: [],
    location: '',
    availability: 'Available',
    experience: '',
    dailyRate: '',
    description: '',
    // Contractor specific fields
    companyName: '',
    businessType: '',
    address: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSkillChange = (e) => {
    const skills = e.target.value.split(',').map(skill => skill.trim());
    setFormData(prev => ({
      ...prev,
      skills
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    try {
      const res = await axios.post('http://localhost:8080/api/auth/register', formData);
      setSuccess('Registration successful! Redirecting to login...');
      setTimeout(() => {
        navigate('/login');
      }, 2000);
    } catch (err) {
      setError(err.response?.data?.message || 'Registration failed');
    }
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen px-4 py-8">
      <div className="w-full max-w-2xl bg-dark-800 rounded-xl shadow-2xl p-8 border border-dark-700">
        <h2 className="text-3xl font-bold text-primary-400 mb-6 text-center">Create Account</h2>

        {error && <div className="mb-4 p-3 bg-red-900/50 border border-red-700 rounded-md text-red-400">{error}</div>}
        {success && <div className="mb-4 p-3 bg-green-900/50 border border-green-700 rounded-md text-green-400">{success}</div>}

        <form onSubmit={handleSubmit} className="space-y-6">
          {/* Basic Information */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <label className="block text-sm font-medium text-gray-300">Full Name</label>
              <input
                type="text"
                name="name"
                className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-300">Email</label>
              <input
                type="email"
                name="email"
                className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-300">Phone Number</label>
              <input
                type="tel"
                name="phone"
                className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                value={formData.phone}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-300">Password</label>
              <input
                type="password"
                name="password"
                className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                value={formData.password}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label className="block text-sm font-medium text-gray-300">Role</label>
              <select
                name="role"
                className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                value={formData.role}
                onChange={handleChange}
              >
                <option value="WORKER">Worker</option>
                <option value="CONTRACTOR">Contractor</option>
              </select>
            </div>
          </div>

          {/* Worker Specific Fields */}
          {formData.role === 'WORKER' && (
            <div className="space-y-4 border-t border-dark-700 pt-4">
              <h3 className="text-lg font-semibold text-primary-400">Worker Information</h3>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-300">Skills (comma separated)</label>
                  <input
                    type="text"
                    name="skills"
                    placeholder="e.g., Masonry, Carpentry, Plumbing"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.skills.join(', ')}
                    onChange={handleSkillChange}
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-300">Location</label>
                  <input
                    type="text"
                    name="location"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.location}
                    onChange={handleChange}
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-300">Availability</label>
                  <select
                    name="availability"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.availability}
                    onChange={handleChange}
                  >
                    <option value="Available">Available</option>
                    <option value="Busy">Busy</option>
                    <option value="Part-time">Part-time</option>
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-300">Experience (years)</label>
                  <input
                    type="number"
                    name="experience"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.experience}
                    onChange={handleChange}
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-300">Daily Rate (₹)</label>
                  <input
                    type="number"
                    name="dailyRate"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.dailyRate}
                    onChange={handleChange}
                  />
                </div>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-300">Description</label>
                <textarea
                  name="description"
                  rows="3"
                  className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                  value={formData.description}
                  onChange={handleChange}
                />
              </div>
            </div>
          )}

          {/* Contractor Specific Fields */}
          {formData.role === 'CONTRACTOR' && (
            <div className="space-y-4 border-t border-dark-700 pt-4">
              <h3 className="text-lg font-semibold text-secondary-400">Contractor Information</h3>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-300">Company Name</label>
                  <input
                    type="text"
                    name="companyName"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.companyName}
                    onChange={handleChange}
                  />
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-300">Business Type</label>
                  <input
                    type="text"
                    name="businessType"
                    className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                    value={formData.businessType}
                    onChange={handleChange}
                  />
                </div>
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-300">Address</label>
                <textarea
                  name="address"
                  rows="3"
                  className="mt-1 block w-full rounded-md bg-dark-700 border-dark-600 text-white shadow-sm focus:ring-primary-500 focus:border-primary-500"
                  value={formData.address}
                  onChange={handleChange}
                />
              </div>
            </div>
          )}

          <button
            type="submit"
            className="w-full py-3 px-4 bg-gradient-to-r from-primary-600 to-secondary-600 hover:from-primary-700 hover:to-secondary-700 text-white font-semibold rounded-md shadow-lg transition-all duration-200"
          >
            Create Account
          </button>
        </form>

        <div className="mt-6 text-center text-sm text-gray-400">
          Already have an account?{' '}
          <Link to="/login" className="text-primary-400 hover:text-primary-300 underline font-medium">
            Login here
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Register;
